import React from "react";
import {firebase , auth} from "../../base";
const Rooms = ({history}) => {

    const signOut=()=>{
        firebase.auth().signOut();
        history.push('/home');
    }
    return (
        <div>
             Room Section
            <button onClick={signOut}>Sign out</button>
        </div>
    )
}

export default Rooms
